The Finder is an American procedural drama television series created by Hart Hanson that ran on Fox from January 12, 2012 to May 11, 2012. The series originally aired on Thursdays at 9:00 pm. It is a spin-off of another Fox television series, Bones. The backdoor pilot, entitled &quot;The Finder&quot;, aired in its sixth season. It is loosely based on The Locator series of two books by Richard Greener.
The Finder moved to Fridays on April 6, 2012, at 8:00 pm ET/PT, bumping the debut of Gordon Ramsay's new series, Hotel Hell, to the summer. On May 9, 2012, it was announced FOX had canceled the show. &lt;a href=&quot;
